import React from 'react';
import '../../Navigation.css';
import border from '../../../../img/navBorder.png';

function NavBar() {
    return (
      <div className="navigation__navBar">
            <i><img src={border} alt="fa-bars" /></i>
            <h2>Home > Checkout</h2>
      </div>
    );
}

export default NavBar;
